import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import Link from "@material-ui/core/Link";
import Box from "@material-ui/core/Box";
import Divider from "@material-ui/core/Divider";

//icons
import onsiteIcon from "../../img/profile/hospital.png";
import phoneIcon from "../../img/profile/phone.png";
import onlineIcon from "../../img/profile/link.png";
import emailIcon from "../../img/profile/mail.png";

const useStyles = makeStyles((theme) => ({
  icon: {
    width: "20%",
    [theme.breakpoints.down("md")]: {
      width: "30%",
    },
    [theme.breakpoints.down("xs")]: {
      width: "15%",
    },
  },
  divider: {
    height: 2,
    width: 172,
    backgroundColor: "#FF8686",
  },
  appointmentBox: {
    [theme.breakpoints.up("sm")]: {
      justifyContent: "center",
      alignItems: "center",
    },
    [theme.breakpoints.down("sm")]: {
      justifyContent: "left",
      alignItems: "left",
      marginLeft: 20,
    },
  },
}));

//Make appointment section (used in Profile.js inside pages folder)
export default function Appointment(props) {
  const classes = useStyles();


  // create grid based on appointment list




  return (
    <div>
      <Box
        mt={2}
        mb={5}
        display="flex"
        flexDirection="column"
        className={classes.appointmentBox}
      >
        <Typography variant="h6" color="primary">
          Make Appointment
        </Typography>
        <Divider className={classes.divider} />
      </Box>
      <Grid container spacing={0}>
        <Grid item sm={2}></Grid>
        <Grid item xs={6} sm={2}>
          <Box
            display="flex"
            flexDirection="column"
            justifyContent="center"
            alignItems="center"
            mb={2}
          >
            <img
              src={onsiteIcon}
              className={classes.icon}
              alt="onsiteicon"
            ></img>
            <br></br>

            <Typography variant="body1" color="primary">
              On site
            </Typography>
          </Box>
        </Grid>
        <Grid item xs={6} sm={2}>
          <Box
            display="flex"
            flexDirection="column"
            justifyContent="center"
            alignItems="center"
            mb={2}
          >
            <img src={phoneIcon} className={classes.icon} alt="phoneicon"></img>
            <br></br>
            <Link style={{ textDecoration: "underline" }}>+603-22960763</Link>
          </Box>
        </Grid>

        <Grid item xs={6} sm={2}>
          <Box
            display="flex"
            flexDirection="column"
            justifyContent="center"
            alignItems="center"
            mb={2}
          >
            <img
              src={onlineIcon}
              className={classes.icon}
              alt="onlineicon"
            ></img>
            <br></br>
            <Link style={{ textDecoration: "underline" }}>Online</Link>
          </Box>
        </Grid>
        <Grid item xs={6} sm={2}>
          <Box
            display="flex"
            flexDirection="column"
            justifyContent="center"
            alignItems="center"
            mb={2}
          >
            <img src={emailIcon} className={classes.icon} alt="emailicon"></img>
            <br></br>
            <Link style={{ textDecoration: "underline" }}>Email</Link>
          </Box>
        </Grid>
        <Grid item sm={2}></Grid>
      </Grid>
    </div>
  );
}
